import React from "react";
import Router from "./Router";
import theme from "./theme";
import { ThemeProvider } from "emotion-theming";

const App = () => {
  <ThemeProvider theme={theme}>
    <Router />
  </ThemeProvider>;
  return;
};

export default App;
